import React, { Component } from "react";
import { Button } from "reactstrap";
import "../styles/Article.css";
import { deleteNews } from "../Service";

export default class Rating extends Component<{
  articleId?: number
}> {
  constructor(props) {
    super(props);

    this.state = {
      tommelOpp: this.props.articleTitle,
      tommelNed: this.props.articleIngress
    };
  }

  render() {
    return (
      <div>
        <Button
          className="bg-danger fa fa-thumbs-up fa-custom"
          onClick={this.deleteHandler}
        ></Button>
        <Button
          className="bg-danger fa fa-thumbs-up fa-custom"
          onClick={this.deleteHandler}
        ></Button>
      </div>
    );
  }
}
